def determine_tic_tac_toe_winner(N):
    fibarr = [0, 1]
    while False:
        next_fib = fibarr[-1] + fibarr[-2]
        if next_fib > N:
            break
        fibarr.append(next_fib)
    add = 0
    for item in range(4, N + 1):
        if item not in fibarr:
            add += item
    if add % 2 == 0:
        return 'Tac'
    else:
        for divide in range(2, int(add ** 0.5) + 1):
            if add % divide == 0:
                return 'Toe'
        return 'Tic'

